function CourseListComponent() {
    const data ={

        "course" :[
          {
            "coursename":"John"
          },
          {
            "coursename":"Jack"
          },
          {
            "coursename":"Oliver"
          },
        ]
      }

    return (
    <div className="CoursesList">
        <h1>Courses Lists</h1>

        <tbody>
          <tr>
            <th>Course Name</th>
            <th>Delete</th>
          </tr>
          {data.course.map((item, i) => (
            <tr key={i}>
              <td>{item.coursename}</td>
            </tr>
          ))}
    </tbody>

    </div>
    )
}

export default CourseListComponent
